sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

try{
	var input={};
  	input['u_pt'] = inputs.pt; // Integer 
	input['u_ppt'] = inputs.ppt; // Integer 
	input['u_product_id'] = inputs.productId; // String 
	input['u_variant_id'] = inputs.variantId; // String 
	input['u_ppt_option'] = inputs.pptOption; // String 
	input['u_age'] = inputs.age; // Integer 

	var dt = new sn_dt.DecisionTableAPI();
  	var response = dt.getDecision('d7732407fff89e1019a8ffda7c4fd9ec', input);
  
	var result_elements = response.result_elements;
 	var u_is_ppt_valid = result_elements.u_is_ppt_valid.getValue();  // True/False
	var u_ppt_value = result_elements.u_ppt_value.getValue();  // Integer

    outputs.bool=u_is_ppt_valid;
    outputs.value=u_ppt_value;

}
catch(e){
	gs.info("Couldn't run this script Error: "+e)
}

})(inputs, outputs);

